<h3 className='netOriginal'>A netflix Original</h3>
<h2 className='moVie'>Game of thrones</h2>
<span className='Imd'>Imdb rating</span>
<a href='' target=''>
  <button>Watch now</button>
</a>

</div>
</div>
 </div>

 <img src="got.jpg" alt='Movie Banner'/>
 </> ,
